import React from 'react'
//Creating functional Component
export const Tile = (props) => 
{
    return(
        <div className={props.pmark === "" ? 'tile turn_' +props.turn: 'tile' + 'checked_'+props.pmark } onClick={props.clickFn} id={props.cid}></div>
        );
}
